import React,{Component} from 'react'
import TodoList from './todo-list'

export default class showHide extends Component{
    state = {
        show:true
    }

    show = () => {
        this.setState({
            show:!show
        })
    }

    render() {

        <TodoList props={this.state.todos}></TodoList>
    }

}
